void process(APDU apdu, short len) {
    byte* buffer = apduGetBuffer(apdu);
    short ins = buffer[APDU_INS];
    short slots = READ_SHORT(buffer, 2);  // P1:P2
    short result = 0;

    if (ins != 0x01) {
        throwError(0x6D00);
        return;
    }

    // Dispatch to the appropriate test function
    switch (slots) {
        case 1: result = test_1(); break;
        case 2: result = test_2(); break;
        case 3: result = test_3(); break;
        case 5: result = test_5(); break;
        case 7: result = test_7(); break;
        case 11: result = test_11(); break;
        case 15: result = test_15(); break;
        case 23: result = test_23(); break;
        case 31: result = test_31(); break;
        case 47: result = test_47(); break;
        case 63: result = test_63(); break;
        case 95: result = test_95(); break;
        case 127: result = test_127(); break;
        case 191: result = test_191(); break;
        case 255: result = test_255(); break;
        default:
            throwError(0x6A86);  // Unsupported slot count
            return;
    }

    // Return the result
    buffer[0] = (byte)(result >> 8);
    buffer[1] = (byte)result;
    APDU_SEND(apdu, 2);
}
